import { Fade } from "react-awesome-reveal";

const Description = () => {
  return (
    <Fade>
      <div className="center_wrapper">
        <h2>Highlights</h2>
        <div>
          Congue blandit interdum class rutrum malesuada luctus mus, dignissim
          cursus aptent dui lacinia rhoncus auctor, vulputate iaculis nibh metus
          morbi inceptos. Pellentesque leo rhoncus felis condimentum dictum per,
          habitasse imperdiet urna hac quam sed senectus, lacus feugiat justo
          sociosqu ultrices. Cras dapibus posuere vestibulum tempor dignissim
          tincidunt curae ut, quam molestie suscipit fringilla sollicitudin est
          per in, convallis a netus morbi hendrerit arcu ac.
        </div>
      </div>
    </Fade>
  );
};

export default Description;
